window.bookSummaryJSON = "<p><b>Ajoni \"Khaotic\" Brooks lives his life like any other hustler.</b></p> <p>He makes his money, takes care of his family, and stays out the way. He goes above and beyond for the ones he loves, and that very reason is why he has to do a five-year bid. His last weekend as a free man was spent enjoying life and the little freedom he had left. What he didn't expect was for that night to change his forever.</p> <p>Khatori Lewis is freshly single after finding out her longtime boyfriend has been unfaithful, and with the last person she would expect. Khatori's heartbreak takes place around her birthday, so her sister decides to take her out to forget her troubles. Little does Khatori know that this birthday will always be one to remember.</p> <p>Khaotic and Khatori cross paths at very pivotal points in their lives. Only they don't know how their meeting will leave them tied in ways that they couldn't imagine. Follow them in this fast-paced yet intense love story of when two lives intertwine with each other.</p> <p><i>For mature listeners. A complete list of content warnings can be found on the author's website.</i></p>"; 
